import React from 'react';
import './App.css';

function Visuals() {
  return (
    <div className="form-container">
      <h1 className="form-title">Flight Delay Visualizations</h1>
      <div className="charts-container">
        {/* Mock visuals - Replace with actual charts using a library like Chart.js or D3.js */}
        <div className="chart-item">
          <h3>Delay Frequency by Time of Day</h3>
          <p>Placeholder for a bar chart of delays by time of day.</p>
        </div>
        <div className="chart-item">
          <h3>Delay Causes Distribution</h3>
          <p>Placeholder for a pie chart of delay causes (e.g., Weather, NAS).</p>
        </div>
      </div>
      {/* Button to go back to the Predictor */}
      <button onClick={() => window.location.href = '/'} className="submit-button">
        Back to Predictor
      </button>
    </div>
  );
}

export default Visuals;
